import Link from "next/link";
import { useEffect } from "react";

const sideBar = (props) => {
    useEffect(() => {
        let active = rank.indexOf(props.group);

        document.querySelectorAll(".rankSidebar > li").forEach((li, i) => {
            if(i == active) 
                li.classList.add("active");
            else
                li.classList.add("none");
        })
    });

    const kind = [
        "World", 
        "Reboot",
        "guild",
        "Achievement"
    ]
    
    return (
        <ul className="rankSidebar">
            <Link href={`/ranking/${props.title}Ranking`}><li className="pointer active">월드 랭킹</li></Link>
            <Link href={`/ranking/${props.title}Ranking`}><li className="pointer active">리부트 랭킹</li></Link>
            <Link href={`/ranking/${props.title}Ranking`}><li className="pointer active">길드 랭킹</li></Link>
            <Link href={`/ranking/${props.title}Ranking`}><li className="pointer active">업적 랭킹</li></Link>
        </ul>
    );
};

export default sideBar;
